import React from 'react'

const List =({list})=>  (
    <ul>
      {list.products.map((item)=>(
        <Item item={item}/>
      ))}
  </ul>
  )

const Item = ({item})=>(
<li>

  <span>{item.title}</span>

</li>
);


export default List;
